package algorithm

import (
	"fmt"
	"testing"
)

// 滑动窗口
func findAnagrams(s string, p string) []int {

	if len(s) == 0 || len(p) == 0 {
		return []int{}
	}

	// 26个英文字母算个数
	var equal func(a, b string) bool
	equal = func(a, b string) bool {
		var sCount, pCount [26]int
		for i, ch := range a {
			sCount[b[i]-'a']++
			pCount[ch-'a']++
		}
		return sCount == pCount
	}

	res := make([]int, 0)
	left := 0
	for i := range s {
		if i-left+1 == len(p) {
			subStr := s[left : i+1]
			if equal(subStr, p) {
				res = append(res, left)
			}
			left++
		}
	}

	return res
}

func Test438(t *testing.T) {
	s := ""
	p := ""
	res := findAnagrams(s, p)
	fmt.Println(res)
}
